var title_f19_8_19594="EP study tracings preablation mapping WPW";
var content_f19_8_19594=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F72398%7ECARD%2F78363&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F72398%7ECARD%2F78363&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 609px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface electrocardiogram (ECG) recordings during electrophysiologic (EP) study in Wolff-Parkinson-White syndrome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 589px; height: 419px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are five surface ECG leads (I, aVF, V1, V3, V6) and intracardiac recordings from the high right atrium (HRA), lateral mitral annulus (HBE1-2 and HBE 3-4), coronary sinus (proximal to distal, CS9-10, CS7-8, CS5-6, CS3-4, and CS1-2), and the right ventricular apex (RVA3- 4). During the diagnostic electrophysiology study, orthodromic atrioventricular reentrant tachycardia was induced. Recordings from the CS demonstrated that the earliest site of ventricular activation was at CS7-8, indicating a left lateral location of the accessory pathway (arrow). The mapping catheter (HBE1-2,3-4) was advanced through a patent foramen ovale to the lateral mitral annulus. Activation mapping was used to select the ablation site; during sinus rhythm, the ablation catheter was maneuvered to the site along the mitral annulus which recorded earliest ventricular activity (HBE1-2), ie, the atrial (A) and ventricular (V) electrograms recorded from the ablation catheter tip were continuous and the local ventricular activity preceded the onset of the delta wave on the surface ECG.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 612px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface ECG recordings during electrophysiologic study post-radiofrequency ablation of accessory pathway in Wolff-Parkinson-White",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 592px; height: 422px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are five surface leads (I, AVF, V1, V3, and V6) and intracardiac recording from the high right atrium (HRA), lateral mitral annulus (HBE1-2 and HBE3-4), coronary sinus proximal to distal (CS9-10, 7-8, 5-6, 3-4, 1-2), and right ventricular apex (RVA3-4). The tip of the mapping catheter is positioned at the site along the mitral annulus recording the earliest ventricular activity (HBE1-2), ie, the location of the accessory pathway. Within a few beats after the application of radiofrequency energy (RF on) the delta wave on the ECG disappeared (arrow) and the PR interval normalized. Prior to ablation, he recordings from the CS catheter show continuous atrial (A) and ventricular (V) electrograms; after ablation there is a normal interval between A and V.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
