var title_f19_8_19596="Histologic features NSIP";
var content_f19_8_19596=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F81034&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F81034&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Histologic features of nonspecific interstitial pneumonia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Key histologic features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Cellular pattern*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mild to moderate interstitial chronic inflammation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Type II pneumocyte hyperplasia in areas of inflammation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Fibrosing pattern*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Dense or loose interstitial fibrosis lacking the temporal heterogeneity pattern and/or patchy features of UIP",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lung architecture may appear lost on examination of H&amp;E-stained section, but is relatively preserved with elastin stains",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Interstitial chronic inflammation - mild or moderate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Pertinent negative findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Cellular pattern",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Dense interstitial fibrosis: absent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Organizing pneumonia is not a prominent feature",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lack of diffuse severe alveolar septal inflammation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Fibrosing pattern",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Temporal heterogeneity pattern: fibroblastic foci with dense fibrosis are inconspicuous or absent - this is especially important in cases with patchy involvement and subpleural or paraseptal distribution",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Both patterns",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Acute lung injury pattern, especially hyaline membranes: absent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Eosinophils: inconspicuous or absent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Granulomas: inconspicuous or absent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lack of viral inclusions and organisms on special stains for organisms",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * There is a spectrum from cellular to fibrosing patterns, with some cases showing a combination of cellular and fibrosing features.",
"     <br>",
"      UIP: usual interstitial pneumonia; H&amp;E: hematoxylin and eosin.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
