var title_f19_8_19597="Thromboprophylaxis recommendations";
var content_f19_8_19597=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F69149&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F69149&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommended thromboprophylaxis for pregnancies complicated by inherited thrombophlias*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Clinical scenario",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antepartum management",
"       </td>",
"       <td class=\"subtitle1\">",
"        Postpartum management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Low-risk thrombophilia",
"        <sup>",
"         &bull;",
"        </sup>",
"        without previous VTE",
"       </td>",
"       <td>",
"        Surveillance without anticoagulation therapy or prophylactic LMWH or UFH",
"       </td>",
"       <td>",
"        Surveillance without anticoagulation therapy or postpartum anticoagulation therapy if the patient has additional risks factors",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Low-risk thrombophilia",
"        <sup>",
"         &bull;",
"        </sup>",
"        with a single previous episode of VTE - not receiving long-term anticoagulation therapy",
"       </td>",
"       <td>",
"        Prophylactic or intermediate-dose LMWH/UFH or surveillance without anticoagulation therapy",
"       </td>",
"       <td>",
"        Postpartum anticoagulation therapy or intermediate-dose LMWH/UFH",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High-risk thrombophilia",
"        <sup>",
"         &loz;",
"        </sup>",
"        without previous VTE",
"       </td>",
"       <td>",
"        Prophylactic LMWH or UFH",
"       </td>",
"       <td>",
"        Postpartum anticoagulation therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        High-risk thrombophilia",
"        <sup>",
"         &loz;",
"        </sup>",
"        with a single previous episode of VTE - not receiving long-term anticoagulation therapy",
"       </td>",
"       <td>",
"        Prophylactic, intermediate-dose, or adjusted-dose LMWH/UFH regimen",
"       </td>",
"       <td>",
"        Postpartum anticoagulation therapy or intermediate- or adjusted-dose LMWH/UFH for 6 weeks (therapy level should be at least as high as antepartum treatment)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No thrombophilia with previous single episode of VTE associated with transient risk factor that is no longer present - excludes pregnancy- or estrogen-related risk factor",
"       </td>",
"       <td>",
"        Surveillance without anticoagulation therapy",
"       </td>",
"       <td>",
"        Postpartum anticoagulation therapy",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No thrombophilia with previous single episode of VTE associated with transient risk factor that was pregnancy- or estrogen-related",
"       </td>",
"       <td>",
"        Prophylactic-dose LMWH or UFH",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"       <td>",
"        Postpartum anticoagulation therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No thrombophilia with previous single episode of VTE without an associated risk factor (idiopathic) - not receiving long-term anticoagulation therapy",
"       </td>",
"       <td>",
"        Prophylactic-dose LMWH or UFH",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"       <td>",
"        Postpartum anticoagulation therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thrombophilia or no thrombophilia with two or more episodes of VTE - not receiving long-term anticoagulation therapy",
"       </td>",
"       <td>",
"        <p>",
"         Prophylactic- or therapeutic-dose LMWH",
"        </p>",
"        <p>",
"         OR",
"        </p>",
"        <p>",
"         Prophylactic- or therapeutic-dose UFH",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Postpartum anticoagulation therapy",
"        </p>",
"        <p>",
"         OR",
"        </p>",
"        <p>",
"         Therapeutic-dose LMWH/UFH for 6 weeks",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thrombophilia or no thrombophilia with two or more episodes of VTE - receiving long-term anticoagulation therapy",
"       </td>",
"       <td>",
"        Therapeutic-dose LMWH/UFH",
"       </td>",
"       <td>",
"        Resumption of long-term anticoagulation therapy",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     LMWH: low molecular weight heparin; UFH: unfractionated heparin; VTE: venous thromboembolism.",
"     <br>",
"      * Postpartum treatment levels should be greater or equal to antepartum treatment. Treatment of acute VTE and management of antiphospholipid syndrome are addressed elsewhere.",
"      <br>",
"       <span class=\"bullet\">",
"        &bull;",
"       </span>",
"       Low-risk thrombophilia: factor V Leiden heterozygous; prothrombin",
"       <em>",
"        G20210A",
"       </em>",
"       heterozygous; protein C or protein S deficiency.",
"       <br>",
"        &Delta; First-degree relative with a history of a thrombotic episode before age 50 years, or other major thrombotic risk factors (eg, obesity, prolonged immobility).",
"        <br>",
"         <span class=\"lozenge\">",
"          &loz;",
"         </span>",
"         High-risk thrombophilia: antithrombin deficiency; double heterozygous for prothrombin",
"         <em>",
"          G20210A",
"         </em>",
"         mutation and factor V Leiden; factor V Leiden homozygous or prothrombin",
"         <em>",
"          G20210A",
"         </em>",
"         mutation homozygous.",
"         <br>",
"          &sect; Surveillance without anticoagulation therapy is supported as an alternative approach by some experts.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: ACOG Practice Bulletin #123. Thromboembolism in pregnancy. Obstet Gynecol 2011; 118:718. Copyright &copy; 2011 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
